import  { FC } from 'React';
import styled from 'styled-components';

import { Wrapper } from '../../styledHelpers/Components';
import { Colors } from '../../styledHelpers/colors';
import Link from '../Link' ;


const LeftPanel = styled.div`
width:200px;
height:300px;



`;
const TopPanel = styled.div`
height:150px;
width:200px;

outline-style: outset;
outline-color: #444444;
clear: both;
padding-left:10px;
`;
const MidPanel = styled.div`
height: 50px;
width:200px;

text-align: left;
outline-style: outset;
outline-color: #3f3f3f;
clear: both;
padding-left:10px;

`;
const BottomPanel = styled.div`
padding-left:10px;
`;
const ProfIcon = styled.div`
`;
const PubICon = styled.div`
padding-top:10px;
`;
const EcoICon = styled.div`
padding-top:10px;
`;
const EntIcon = styled.div`
padding-top:10px;
`;
const PartOne = styled.div`
`;
const PartTwo = styled.div`
padding-top:7px;
`;

export const LeftMenu: FC = () => {
    return (
        <LeftPanel>
            <TopPanel>
                <ProfIcon>
                <label>job    title    company</label>
                </ProfIcon>
            </TopPanel>
            <MidPanel>
                <PartOne>
                    <img src="./media/icons/network.png" alt=""></img>
                    <Link href= "" style={{padding:"20px"}}  >Your Network</Link>
                    <img src="./media/icons/user-plus.png"  alt=""></img>
                </PartOne>
                <PartTwo>
                    <img src="./media/icons/publications.png" alt=""></img>
                    <Link href= "" style={{padding:"20px"}}  >Your Publications</Link>
                    <img src="./media/icons/plus.png" alt="" style={{}}></img>
                </PartTwo>

            </MidPanel>
            <BottomPanel>
                <PubICon>
                    <img src="./media/icons/publications.png" alt=""></img>
                    <Link href= "" style={{padding:"10px"}}  >publications</Link>
                </PubICon>
                <EcoICon>
                    <img src="./media/icons/ecosystem.png" alt=""></img>
                    <Link href= "" style={{padding:"20px"}}  >ecosystem</Link>
                </EcoICon>
                <EntIcon>
                    <img src="./media/icons/entities.png"alt=""></img>
                    <a href= "" style={{padding:"10px"}}  >entities</a>
                </EntIcon>

            </BottomPanel>
        </LeftPanel>
    );
};
